#body{
width:100%;
max-width:405px;
z-index:999999;
margin:0 auto 0 auto;
display:none;
height:35vh;
overflow:auto;
position:relative;
float:none;
scrollbar-color: white transparent;
font-size:24px;
font-family: 'Caveat', cursive;
color:white;
font-weight:100;
}
.answerbox{
    overflow:hidden;
    width:256px;
    height:256px;
}

.cell, .img, .meta, .text{
    margin:0;
    padding:0;
    overflow:hidden;

}
.search{
    transition: box-shadow 1s ease-out;
    background-size:cover;
    background-position:center;
}
a{
    white-space: nowrap;
    font-size:11px;
    color:white;
    transition: box-shadow .1s ease-out;
    text-decoration: underline;
    display:inline-block;
    margin-bottom:5px;
    padding:4px;
}
.search a img{
    display:inline;
    height:16px;
    width:16px;
    vertical-align:middle;
    margin-right:4px;
    border-radius:2px;
}
.search:hover, .btn:hover{
    box-shadow: inset 16px 16px 16px rgba(0,0,0,.4),  inset 0 0 32px rgba(0,0,0,.3);
}
.btn:hover{
    box-shadow: inset 8px 8px 8px rgba(0,0,0,.4),  inset 0 0 16px rgba(0,0,0,.3);
}

a:hover{
    box-shadow: 4px 4px 0px rgba(0,0,0,.4),  0 0 8px rgba(0,0,0,.3);
    color:black;
    background-color:white;
}
textarea:active{
    color:white;
}
textarea:hover{
    color:rgba(255,255,255,1);
}
.imgbig{
    width:256px;
    height:256px;
}
.imgmedium{
    width:128px;
    height:128px;
}
.imgsmall{
    width:64px;
    height:64px;
}
.emoji{
    width:32px;
    height:32px;
    transition: text-shadow .1s ease-out;
    padding:16px;
    font-size:22px;
    display:inline-block;
    text-shadow: 8px 8px 8px rgba(0,0,0,.2);
}
.emoji:hover{
    text-shadow:2px 2px rgba(0,0,0,.2);
}

